ext\" style=\"width: 60px; height: 13px;\" name=\"txt_corporate_contact_name\" type=\"text\" value=\"{{corporate_contact_name}}\" /> 契約者との関係<input id=\"txt_corporate_contact_relation\" class=\"box_text\" style=\"width: 40px; height: 13px;\" name=\"txt_corporate_contact_relation\" type=\"text\" value=\"{{corporate_contact_relation}}\" />) </span></td>\r\n<td class=\"border-bottom\" style=\"text-align: center; background-color: #000000; color: #ffffff;\" colspan=\"4\">\r\n<div style=\"font-size: 13px;\">緊急連絡先</div>\r\n<div style=\"font-size: 10px;\">（※ご本人、勤務先以外）</div>\r\n<div style=\"font-size: 10px;\">※必ずご記入ください</div>\r\n</td>\r\n<td class=\"border-bottom border-bottom-3 border-right-3\" style=\"line-height: 19px;\" colspan=\"8\">電話番号：<input id=\"txt_personal_contact_tel\" class=\"box_text\" style=\"width: 130px; height: 13px;\" name=\"txt_personal_contact_tel\" type=\"text\" value=\"{{personal_contact_tel}}\" /><br /> <span style=\"font-size: 12px;\"> (氏名：<input id=\"txt_personal_contact_name\" class=\"box_text\" style=\"width: 60px; height: 13px;\" name=\"txt_personal_contact_name\" type=\"text\" value=\"{{personal_contact_name}}\" /> 契約者との関係<input id=\"txt_personal_contact_relation\" class=\"box_text\" style=\"width: 40px; height: 13px;\" name=\"txt_personal_contact_relation\" type=\"text\" value=\"{{personal_contact_relation}}\" />) </span></td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td class=\"border-left-3 center border-right border-bottom border-bottom-3\" style=\"font-size: 12px;\" rowspan=\"4\">使<br /> 用<br /> 者<br /> ・<br /> 使<br /> 用<br /> 者<br /> 所<br /> 在<br /> 地</td>\r\n<td class=\"border-bottom border-right-dashed\" colspan=\"3\">フリガナ</td>\r\n<td class=\"border-bottom\" colspan=\"7\"><input class=\"box_text\" type=\"text\" value=\"{{corporate_user_kana}}\" /></td>\r\n<td class=\"border-left-3 border-bottom border-right\" style=\"font-size: 9px;\" colspan=\"12\" rowspan=\"2\">&nbsp;★&nbsp;勤務先は必ずご記入ください。（勤務先に在籍確認の連絡をする場合があります。）<br />&nbsp;★&nbsp;個人事業主は、申込時、登記簿等業務内容のわかる公的な資料の提出が必要です。</td>\r\n</tr>\r\n<tr style=\"height: 30px;\">\r\n<td class=\"border-bottom border-right-dashed\" colspan=\"3\">氏名</td>\r\n<td class=\"border-bottom\" colspan=\"7\"><input class=\"box_text\" type=\"text\" value=\"{{corporate_user_name}}\" /></td>\r\n</tr>\r\n<tr style=\"height: 24px;\">\r\n<td class=\"border-bottom border-right-dashed\" colspan=\"3\">携帯電話</td>\r\n<td class=\"border-bottom\" colspan=\"7\"><input class=\"box_text\" type=\"text\" value=\"{{corporate_user_tel}}\" /></td>\r\n<td class=\"border-left-3 border-right center\" colspan=\"12\"><span style=\"font-weight: bold;\">アンケート</span>　どのようにして､この駐車場を知りましたか？</td>\r\n</tr>\r\n<tr style=\"height: 61px;\">\r\n<td class=\"border-bottom border-bottom-3 border-right-dashed\" colspan=\"3\">所在地</td>\r\n<td class=\"border-bottom border-bottom-3\" colspan=\"7\"><input class=\"box_text\" type=\"text\" value=\"{{corporate_user_address1}}\" /></td>\r\n<td class=\"border-left-3 border-bottom border-right\" style=\"padding-left: 5px; line-height: 25px;\" colspan=\"12\"><input id=\"chkRouteFlier\" name=\"chk_route_flier\" type=\"checkbox\" /><label for=\"chkRouteFlier\">チラシ</label> <input id=\"chkRouteInternet\" name=\"chk_route_internet\" type=\"checkbox\" /><label for=\"chkRouteInternet\">インターネット</label> <input id=\"chkRouteBoard\" name=\"chk_route_board\" type=\"checkbox\" /><label for=\"chkRouteBoard\">看板</label> <input id=\"chkRouteNews\" name=\"chk_route_news\" type=\"checkbox\" /><label for=\"chkRouteNews\">新聞折込</label> <br /> <input id=\"chkRouteEstate\" name=\"chk_route_estate\" type=\"checkbox\" /><label for=\"chkRouteEstate\">不動産紹介</label> <input id=\"chkRouteIntroduced\" name=\"chk_route_introduced\" type=\"checkbox\" /><label for=\"chkRouteIntroduced\">知人紹介</label> <input id=\"chkRouteOther\" name=\"chk_route_other\" type=\"checkbox\" /><label for=\"chkRouteOther\">その他</label> （<input id=\"txtRouteOther\" class=\"line_text\" style=\"width: 130px;\" name=\"txt_route_other\" type=\"text\" />）</td>\r\n</tr>\r\n<tr style=\"height: 30px; font-size: 15px;\">\r\n<td class=\"bold\" style=\"background-color: #000000; color: #ffffff;\" colspan=\"17\">申込書の到着時点で当駐車場が満車になっていた場合､順番待ちを希望しますか？&rArr;</td>\r\n<td class=\"center\" colspan=\"6\"><input id=\"rdoWaitingYes\" name=\"rdo_waiting\" type=\"radio\" value=\"yes\" /> <label class=\"bold\" style=\"font-size: 15px;\" for=\"rdoWaitingYes\">はい</label> <input id=\"rdoWaitingNo\" name=\"rdo_waiting\" type=\"radio\" value=\"no\" /> <label class=\"bold\" style=\"font-size: 15px;\" for=\"rdoWaitingNo\">いいえ</label></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div style=\"text-align: center; font-size: 14px;\">書類送付先：{{company_name}}&nbsp;&nbsp;TEL.{{company_tel}}/FAX.{{company_fax}}/E-mail：{{company_email}}</div>\r\n{% csrf_token %}</form>\r\n</body>\r\n</html>',0);
